    //         setPeople(response.data)
    //     })
    // }, [])
    let people = {'id': 1,
     'first_name': 'Анюшка',
      'last_name': 'Жунина',
       'three_name': 'Денисовна',
        'about': 'Менеджер по работе с сушами'}

    return (
        <div className='peopleGet'>

                {people.map(p => (
                    <div className='userCard'>
                        <div className='username'>
                            <p key={p.id}>{p.last_name}</p>
                            <p key={p.id}>{p.first_name}</p>
                            <p key={p.id}>{p.three_name}</p>
                            <p className='about' key={p.id}>{p.about}</p>
                        </div>
                        <img className='avatar' src='public/photo_2021-11-16_01-00-01.jpg'></img>
                    </div>
                ))}
        </div>
    )
}

export default PersonGet;
